Address interaction as it unfolds over time and in collaboration between people, and \emph{not} as a simple relation between human beings and computers: Unfolding and becoming  in the multiplicity of people, activities, devices and software, in which technology get used and developed.

Design for understandability and control of common interactive objects.

Empower users to better understand and develop the technologies they use. This entails means and a language for more diverse communities of users to apprehend and develop their own technologies together (Conceptual blends and double level language).

Support malleability within and across practices, and provide support for development in use, by the community (and individual users)

Allow/accommodate overlapping communities of users to develop their (use around the) common objects. Embrace contradiction and conflict.

Support (community) privacy and ownership. Give communities support to control boundaries.





\subsection{Applying Design Principles}

\WM{Describe how the principles have been applied to 3-5 interactive systems}

Different prototypical examples of common forms of interaction are, e.g. family calendars \cite{Bødker & Grönvall, 2013}, parental leave planning \cite{Borchorst et al., 2009; Borchorst & Bødker, 2011}, shared art curation \cite{Bødker & Polli 2014} and community artifact ecologies for food sharing \cite{Bødker et al 2016a and b, Bødker & Lyle 2017}. Mediating qualities of such common interactive objects, their potentials for sharing and boundary drawing have been the starting point for further theoretical conception.

